// File: src/components/BusinessManagement.js
// Last Modified: 2026-03-29

import React from 'react';
import { TextField, Button, Typography, Card, CardContent, Box } from '@mui/material';
import { fetchBusinessDetails as fetchBusinessDetailsApi } from '../services/testService'; // Corrected import path

function BusinessManagement({
    businessName,
    setBusinessName,
    businessOutput,
    setBusinessOutput,
    handleSnackbarOpen,
    apiKey,
    businessId,
}) {
    const handleFetchBusinessDetails = async () => {
        if (!businessId) {
            setBusinessOutput("Please enter a Business ID.");
            handleSnackbarOpen("Please enter a Business ID.", "warning");
            return;
        }

        console.log("BusinessManagement.js - handleFetchBusinessDetails called");
        console.log("BusinessManagement.js - businessId:", businessId);
        console.log("BusinessManagement.js - apiKey:", apiKey);

        try {
            const response = await fetchBusinessDetailsApi(businessId, apiKey); // Call testService API call
            console.log("BusinessManagement.js - API Response:", response);
            setBusinessOutput(JSON.stringify(response, null, 2)); // this data will be displayed in json form
            handleSnackbarOpen("Business endpoint Fetched!", "info");

        } catch (error) {
            console.error("BusinessManagement.js - API Error:", error);
            setBusinessOutput(`Error: ${error.message}`);
            handleSnackbarOpen(error.message, "error");
        }
    };

    return (
        <Card sx={{ mt: 2 }}>
            <CardContent>
                <Typography variant="h6" gutterBottom>Business Management</Typography>
                <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, mt: 2 }}>
                    <TextField
                        label="Business Name"
                        variant="outlined"
                        value={businessName}
                        onChange={(e) => setBusinessName(e.target.value)}
                    />
                    <Button variant="contained" onClick={() => console.log("Create Business not yet implemented")}>
                        Create Business
                    </Button>
                    <Button variant="contained" onClick={handleFetchBusinessDetails}>
                        Fetch Business Details
                    </Button>
                    <Typography variant="body1">{businessOutput}</Typography>
                </Box>
            </CardContent>
        </Card>
    );
}

export default BusinessManagement;
